import React from 'react'
import { View, Text, StyleSheet } from 'react-native'
import { Link } from 'react-router-native'

export default function Sidebar() {
    return (
        <View style={styles.sidebar}>
            <Text>Hello</Text>
            <Link to="/">
                <Text>Home</Text>
            </Link> 
            <Link to="/dashboard">
                <Text>Dashboard</Text>
            </Link>
            <Link to="/mapCovid">
                <Text>Map Covid</Text>
            </Link>
        </View>
    )
}


const styles = StyleSheet.create({
    sidebar: {
        backgroundColor: "#000",
        width: 250,
        minHeight: "100vh",
    }
})
